<template>
  <div>
    <v-row class="justify-center" v-if="mensaje_error">
      <v-alert text color="error" dense>
        <v-icon color="error"> mdi-alert </v-icon>
        <span v-text="mensaje_error" class="ml-1"> </span>
      </v-alert>
    </v-row>
    <v-container class="px-0 px-sm-6" v-if ="atletas.length && mensaje_error===''">
      <v-row no-gutters>
        <v-col cols="12" lg="12" xl="12" class="elevation-4 py-4 px-sm-6 px-0 rounded-lg">
          <v-row align="center">
            <v-col cols="12">
              <v-text-field class="mx-2 mx-sm-0" clear-icon="mdi-close" clearable label="Buscar" 
              prepend-icon="mdi-magnify" type="text" v-model="busqueda_atleta" name="busqueda"> </v-text-field>
            </v-col>
          </v-row>
          <v-row>
            <v-col cols="12"> 
              <v-data-table :headers="atributos_tabla" :items="atletas" :search="busqueda_atleta" 
              no-data-text="No hay atletas registrados para esta categoría."
              no-results-text="No hay resultados para esta búsqueda."
              loading-text="Cargando datos..."
              locale="es-VE"
              fixed-header
              :loading="tabla_cargando"
              >
                <template v-slot:item.educacion_etapa="{ item }"> 
                  <span :class="item.educacion_etapa==='No especificada'? 'grey--text' : ''" v-text="item.educacion_etapa"> </span>
                </template>
                <template v-slot:item.correo="{ item }"> 
                  <span :class="item.correo==='Sin correo'? 'grey--text' : ''" class="d-inline-block pt-1 d-sm-none text-truncate mr-0" style="max-width: 130px;" v-text="item.correo"> </span>
                  <span :class="item.correo==='Sin correo'? 'grey--text' : ''" class="d-none d-sm-flex" v-text="item.correo"> </span>
                </template>
              </v-data-table>       
            </v-col>
          </v-row>
        </v-col>
        <v-row class=" mt-3 justify-center justify-sm-end" v-if="chartData.length">
          <v-dialog v-model="dialog" class="text-center" max-width="600">
            <template v-slot:activator="{ on, attrs }"> 
              <v-btn color="indigo" dark v-bind="attrs" v-on="on" @click="mostrarGrafica" class="mx-0 mr-2 mt-2 mt-sm-0"> 
                <v-icon left> mdi-chart-arc </v-icon>
                Atletas por Educación
              </v-btn>        
            </template>
            <v-card rounded="md" style="border: 0px">
              <v-card-title>
                <span class="d-none d-sm-flex"> Atletas por Educación </span>
                <b class="d-flex d-sm-none text-subtitle-1 font-weight-bold"> Atletas por Educación </b>
                <v-spacer> </v-spacer>
                <v-btn icon @click="dialog = false"><v-icon> mdi-close </v-icon></v-btn>
              </v-card-title>
              <v-card-text v-if="!dialog_chart" class="mt-2"> 
                <v-progress-linear indeterminate color="primary"> </v-progress-linear>
              </v-card-text>
              <v-card-text v-else>
                <div class="d-flex justify-center mt-2">
                  <ApexChart width="550" type="donut" :options="chartOptions" :series="chartData" class="elevation-4 p-4 rounded-lg grey lighten-4" /> 
                </div>
              </v-card-text>
              <v-card-actions> 
                <v-spacer></v-spacer>
                <v-btn color="grey darken-1" dark @click="dialog = false">
                  <v-icon left> mdi-close </v-icon>
                  Cerrar
                </v-btn>
              </v-card-actions>
            </v-card>
          </v-dialog>               
          <v-btn color="primary mt-2 mt-sm-0 mr-sm-3" @click="getReporte" :disabled="atletas.length? false : true">
            <v-icon left>mdi-download</v-icon>
              Generar Reporte
          </v-btn>
        </v-row>
      </v-row>   
    </v-container>
    <v-row v-else-if="!atletas.length && !tabla_cargando && mensaje_error===''">
      <v-col class="grey--text text-center"> No hay atletas inscritos en la categoría especificada. </v-col>
    </v-row>
  </div>
</template>

<script>
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";
pdfMake.vfs = pdfFonts.pdfMake.vfs;
import ApexChart from 'vue-apexcharts';
import axios from 'axios';
const server_url = sessionStorage.getItem('SERVER_URL');
export default {
  name: 'NominaEquipo',
  components: {
    ApexChart
  },
  props:{
    categoria: {},
    equipo: {}
  },
  data() {
    return {

      /*UI handlers*/
      tabla_cargando: false,
      busqueda_atleta: '',
      atletas: [],
      mensaje_error: '',
      dialog: false,
      dialog_chart: false,
      // headers de la tabla
      atributos_tabla: [
        {
          text: 'Nro. Cédula',
          align: 'start',
          sortable: true,
          filterable: true,
          value: 'cedula',
          class: 'primary--text font-weight-bold'
        },
        {
          text: 'Nombre Completo',
          align: 'start',
          sortable: true,
          filterable: true,
          value: 'nombre_completo',
          class: 'primary--text font-weight-bold'
        },
        {
          text: 'Correo Electrónico',
          align: 'start',
          sortable: true,
          filterable: true,
          value: 'correo',
          class: 'primary--text font-weight-bold'
        },
        {
          text: 'Educación',
          align: 'start',
          sortable: true,
          filterable: true,
          value: 'educacion_etapa',
          class: 'primary--text font-weight-bold'
        },
      ],

      chartOptions: {
        chart: {
          type: 'donut',
          offsetY: 0,
          margin: 0,
          
        },
        fill: {
          opacity: '0.85'
        },
        animations: {
          speed: 1600
        },

        legend: {
          offsetX: 0,
          offsetY: 0,
          floating: false,
          position: 'bottom'
        },
        responsive: [
          {
            breakpoint: 350,
            options: {
              chart: {
                size: 100,
                width: 250,
                height: 800
              },
              plotOptions: {
                donut: {
                  labels: {
                    show: false
                  }
                }
              },
              legend: {
                position: 'bottom'
              }
            }
          },
          {
            breakpoint: 375,
            options: {
              chart: {
                size: 100,
                width: 260,
                height: 900
              },
              plotOptions: {
                donut: {
                  labels: {
                    show: false
                  }
                }
              },
              legend: {
                position: 'bottom'
              }
            }
          },
          {
            breakpoint: 410,
            options: {
              chart: {
                size: 100,
                width: 300,
                height: 1000
              },
              plotOptions: {
                donut: {
                  labels: {
                    show: false
                  }
                }
              },
              legend: {
                position: 'bottom'
              }
            }
          },
          {
            breakpoint: 430,
            options: {
              chart: {
                width: 350,
                height: 1000
              },
              legend: {
                position: 'bottom'
              }
            }
          },
          {
            breakpoint: 470,
            options: {
              chart: {
                width: 370,
                height: 1000
              },
              legend: {
                position: 'bottom'
              }
            }
          },
          {
            breakpoint: 500,
            options: {
              chart: {
                width: 400
              },
              legend: {
                position: 'bottom'
              }
            }
          },
          {
            breakpoint: 550,
            options: {
              chart: {
                width: 420
              },
              legend: {
                position: 'bottom'
              }
            }
          },
          {
            breakpoint: 600,
            options: {
              chart: {
                width: 470
              },
              legend: {
                position: 'bottom'
              }
            }
          },
          {
            breakpoint: 630,
            options: {
              chart: {
                width: 470
              },
              legend: {
                position: 'bottom'
              }
            }
          }
        ]
        

      },
      chartData: [],
    }
  },

  watch: {
    //método que se ejecuta cada vez que cambia la categoría(se selecciona otro valor en el select de equipos)
    categoria(){
      this.chartData=[];
      this.mensaje_error='';
      this.getAtletas();
    },
    dialog(){
      if(!this.dialog) setTimeout(() => this.dialog_chart = false, 170);
    }
  },

  methods: {
    //método que genera el reporte
    getReporte(){
      var docDefinition = {
        content: [
          {
            columns: [
              {
                width: 'auto',   
                image: 'data:image/png;base64,',
                fit:[100, 115],margin: [ 0, -10, 0, 0 ]
              },
            ],
            
          },  
          {text: [{text:'Nómina de Equipo: ', bold:true, color: '#2196F3'},{text:`${this.equipo}`}], fontSize: 14, margin: [ 0, 10, 0, 20 ]},
          {
            layout: 'lightHorizontalLines',
        
            table: {
              headerRows:1,
              widths: [70, 130, 140, '*' ],
              body: this.datos_reporte()
            }
          },
        ],
        
        footer: function(currentPage, pageCount) { return {text:`Página ${currentPage.toString()} de ${pageCount}`,fontSize: 10, margin:[40,0,0,0]};}
 
        
      };
      
      pdfMake.createPdf(docDefinition).download(`Nómina Equipo ${this.equipo}`.includes(".")?
      `Nómina Equipo ${this.equipo}.pdf`:
      `Nómina Equipo ${this.equipo}`);
    },
    //datos que contendrá el reporte
    datos_reporte(){
      let reporte_body = [];
      reporte_body.push([
         { text: 'Nro Cédula', bold: true, color:'#2196F3', alignment:'right'},
         { text: 'Nombre Completo', bold: true, color:'#2196F3' },
         { text: 'Correo Electrónico', bold: true, color:'#2196F3' },
         { text: 'Educación', bold: true, color:'#2196F3' },
      ]);

      //todos los atletas del reporte
      this.atletas.forEach((atleta) =>{
        reporte_body.push([
          { text: `${atleta.cedula}`, alignment:'right'},
          { text: `${atleta.nombre_completo}`},
          { text: `${atleta.correo}`, color: `${atleta.correo==='Sin correo'? '#9e9e9e' :''}`},
          { text: `${atleta.educacion_etapa}`, color: `${atleta.educacion_etapa==='No especificada'? '#9e9e9e' :''}`},
        ]);
      });
      
      return reporte_body;
    },
    //método encargado de permitir que se muestre la gráfica con un tamaño acorde a la resolución
    mostrarGrafica(){
      setTimeout(()=>{this.dialog_chart=true},200);
    },
    //método que se encarga de obtener todos los atletas pertenecientes a un equipo en específico
    async getAtletas() {
      this.tabla_cargando = true;
      this.mensaje_error = '';
      await axios.get(`${server_url}/reportes/nomina/equipo/${this.categoria.id_categoria}`, { withCredentials: true } )
        .then((res) => {
          // En caso de exito
          if (res.status === 200) {
            this.atletas = res.data;

            //si existen atletas se busca la educación de todos los atletas y la cantidad de atletas en cada una de esas educaciones para agregar esos datos a la gráfica de atletas por educación del equipo
            if(this.atletas.length !==0){
              this.chartOptions.labels = [];
              this.atletas.forEach(atleta =>{

                //se agrega la educación de los atletas en caso de que la educación no se haya agregado anteriormente a la gráfica
                if(!this.chartOptions.labels.includes(atleta.educacion)){

                  this.chartOptions.labels.push(atleta.educacion);
                  
                  this.chartData.push(this.atletas.filter(atl =>{
                    return atl.educacion === atleta.educacion;
                  }).length);
                  
                }
              });      
            }
          }
        })
        .catch((error) => {
          try {
            // errores
            // Error por parte del servidor
            console.log(error.response.status);
            this.mensaje_error = error.response.data;
          }
          catch (error) {
            // Servidor no disponible
            this.mensaje_error = 'No se ha podido conectar con el servidor, inténtalo de nuevo.';
            console.warn('Warning: No response status was found, is the server running? ');
          }
        });
      this.tabla_cargando = false;
    }, 
  },
  mounted() {
    this.getAtletas();
  }

}
</script>

<style >
.v-data-table-header th{
  white-space: nowrap;
}
</style>